    value: This adjustment is entered to correct an error made in repaying too much
      to the candidate against her outstanding loans.  The amount in question is $1643.88.  The
      other $1400 payment is good and is from debt repayment eligible funds.                      This
      overrepayment has caused three issues with the FEC report.  The first is that
      the campaign account needs to be reimbursed by the candidate for $1643.88.  This
      is being done in April and will be reflected in the final report.                                         The
      second and third issue are interconnected with the proper amount of loan to
      be forgiven and resulting closing cash balence.  The $1643.88 caused a lower
      amount of outstanding loan to be forgiven  At year end
  - name: AMENDED CD
    number: '5'
    value: ' the candidate had $202'
  - value: 500 in outstanding loans.  As a total of $3043.88 was paid to the candidate
  - value: ' $199'
  - value: 456.12 was forgiven on 12-30-05 (202
  - value: 500-3043.88).  However as an extra $1643.88 was paid out
  - value: ' the correct amount of loans to be forgiven should have been $201'
  - value: 100 (202
  - value: 500-1
  - value: 400).  This also caused  closing cash to be lower as the resulting credit
      from loan forgiven was $1643.88 smaller than it should have been.                              To
