    in question is $1643.88.  The other $1400 payment is good and is from debt repayment
    eligible funds.                      This overrepayment has caused three issues
    with the FEC report.  The first is that the campaign account needs to be reimbursed
    by the candidate for $1643.88.  This is being done in April and will be reflected
    in the final report.                                         The second and third
    issue are interconnected with the proper amount of loan to be forgiven and resulting
    closing cash balence.  The $1643.88 caused a lower amount of outstanding loan
